import React from 'react';
import { fade, makeStyles } from '@material-ui/core/styles';
import {Button,Toolbar,Typography, Grid, CardActions,Card,CardMedia, CardContent} from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  card: {
      boxShadow: "none",
  },
  t_text: {
      fontSize: "12px",
      textAlign: "center"
  },
  p_text: {
      fontSize: "15px",
      textAlign: "center"
  }
}));


export default function CarD(props) {
  const classes = useStyles();
  
  return (
      <React.Fragment> 
        <Grid item xs={3} key={props.key}>
            <Card className={classes.card}>
                <CardMedia component="img" image={props.image}></CardMedia>
                <CardContent>
                    <Typography className={classes.t_text}>{props.title}</Typography>
                    <Typography className={classes.p_text}>{props.price}</Typography>
                </CardContent>
                <CardActions>
                    <Toolbar style={{margin}}>
                        <Button variant="contained" color="primary">+</Button>
                        <Typography className={classes.p_text}>1</Typography>
                        <Button variant="contained" color="secondary">-</Button>
                    </Toolbar>
                </CardActions>
            </Card>
        </Grid>
    </React.Fragment>
  );
}
